import React, { useState } from 'react';
import AddIcon from '@material-ui/icons/Add';
import RemoveIcon from '@material-ui/icons/Remove';
import Button from '@material-ui/core/Button';
const App = () =>{
     let [count, setCount] = useState(0);
     const IncData = ()=>{
         setCount(count + 1);
     }

     const DecData = () =>{
         if(count > 0){
            setCount(count - 1);
         }else{
             setCount(0);
             alert('Nagitive value is not Allow');
         }
         
     }
    return (
        <>
          <div className='main_div'>
              <div className='center_div'>
                  <h1>{count}</h1>
                  <div className='btn_div'>
                      <Button className="green"  onClick={IncData}><AddIcon /></Button>
                      <Tooltip title="Delete">
                      <Button className="red"  onClick={DecData}><RemoveIcon /></Button>
                      </Tooltip>
                  </div>
              </div>
          </div>
        </>
    )
}

export default App;
